window.bookSummaryJSON = "<p>An enemy hidden in the shadows<br> A crack in the armor of secrecy<br> One chance to find an answer</p> <p>Captain David Rice and the crew of Red Falcon have spent two years infiltrating the arms smuggling underworld of the Protectorate of the Mage-King of Mars. When the co-opted rebellion on Ardennes reveals a supply chain of weapons intended to fight Mars, this makes them the perfect team to investigate.</p> <p>His new mission brings him across old friends and old enemies alike, but as his suspects start turning up dead, David realizes he isn’t the only one following the loose ends.</p> <p>As shadowy enemies move to position themselves for civil war, Red Falcon’s crew must chase an ever-shrinking set of clues. If they succeed, they might just buy the Protectorate peace for their lifetime.</p> <p>But if they fail…</p>"; 
